__NUXT_JSONP__("/drugs/Fruquintinib", (function(a,b,c){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"1194506-26-7",chebiId:b,chemicalFormula:b,definition:"An orally available, small molecule inhibitor of vascular endothelial growth factor receptors (VEGFRs), with potential anti-angiogenic and antineoplastic activities. Upon oral administration, fruquintinib inhibits VEGF-induced phosphorylation of VEGFRs 1, 2, and 3 which may result in the inhibition of migration, proliferation and survival of endothelial cells, microvessel formation, the inhibition of tumor cell proliferation, and tumor cell death. Expression of VEGFRs may be upregulated in a variety of tumor cell types.",fdaUniiCode:"49DXG3M5ZW",identifier:"C102852",preferredName:a,semanticType:"Pharmacologic Substance",subclassOf:["C129825","C93259"],synonyms:["6-(6,7-Dimethoxyquinazolin-4-yl)oxy-N,2-dimethyl-1-benzofuran-3-carboxamide","Elunate","FRUQUINTINIB",a,"HMPL-013","VEGFR-1\u002F2\u002F3 Inhibitor HMPL-013"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FFruquintinib",extension:".json",createdAt:c,updatedAt:c}}],fetch:{},mutations:void 0}}("Fruquintinib","","2021-10-30T13:17:14.843Z")));